import React from 'react';

const Display = (props) => {
  const { items } = props;

  return (
    <div>
      <h2>Cart Items</h2>
      <ul>
        {items.map((item, index) => (
          <li key={index}>
            {item.name} - {item.description} - {item.price} - Size: {item.size}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Display;
